import React, { Component } from "react";
import { TransformWrapper, TransformComponent } from "react-zoom-pan-pinch";
import TreeOffice from "./CardNode/TreeOffice";



export default function Organigrama() {
    return (
        <>
      <TransformWrapper
        initialScale={0.5}
        maxScale={2}
        initialPositionX={0}
        initialPositionY={0}
        minPositionX={0}
        minPositionY={0}
        maxPositionX={200}
        
      >
        {({ zoomIn, zoomOut, resetTransform, ...rest }) => (
          <React.Fragment>
            <div className="tools">
              <button onClick={() => zoomIn()}>+</button>
              <button onClick={() => zoomOut()}>-</button>
              <button onClick={() => resetTransform()}>x</button>
            </div>
            <TransformComponent  >
                <TreeOffice/>
            </TransformComponent>
          </React.Fragment>
        )}
      </TransformWrapper>
        </>
    )
}
